import React from 'react';
import { Admin, Resource, ListGuesser } from 'react-admin';
import DjangoRestClient from "aor-django-rest-framework";
import  { tokenAuthProvider, fetchJsonWithAuthToken } from 'ra-data-django-rest-framework';
const authProvider = tokenAuthProvider({
    obtainAuthTokenUrl: 'http://localhost:8000/api/rest-auth/login/'
})

const fetch = fetchJsonWithAuthToken('http://localhost:8000/api/rest-auth/login/', {
    Headers: {
        Authorization: 'Token ' + localStorage.getItem('token')
    }
})

const dataProvider= DjangoRestClient('http://localhost:8000/api')

const App = () => {
    console.log(dataProvider)
    document.querySelector('title').innerText = 'Admin'
    return ( 
        <Admin dataProvider={dataProvider} authProvider={authProvider}>
            <Resource name="blogs" list={ListGuesser}></Resource>
            <Resource name="data" list={ListGuesser}></Resource>
            
        </Admin>
     );
}
 
export default App;
